import React from 'react';
import './Login.css';

function Login() {
  return (
    <div className="">
      <h1>Login Page</h1>
      <img
        src="https://getheavy.com/wp-content/uploads/2019/12/spotify2019-830x350.jpg"
        alt="Spotify"
      />
      <button>Login with Spotify</button>
    </div>
  );
}

export default Login;
